import React from "react";
import { Modal, Box, Typography, IconButton } from "@mui/material";

function ModalExplanation( {explanation} ) {
  return (
    <Typography id="modal-modal-description" sx={{ mt: 2 }}>
      {explanation}
    </Typography>
  );
}
export default ModalExplanation;
